Description:
            This wedding planner book contains 150 pages of detailed worksheets and inspiration moodboards to accompany you through your exciting wedding planning journey. It features delicate watercolour eucalyptus leaves and a digitally printed gold font on the front. These planners are your perfect companions before, during and after your wedding day (the are really cute keepsakes too), but they also make perfect gifts for your newly-engaged friends. 
As seen featured on Buzzfeed: https://www.buzzfeed.com/genamourbarrett/planners-that-will-prepare-you-for-2017-and-probably-the?utm_term=.wwGzba463#.bvKwVD4bQ
Are you thinking of getting it posted straight to your friend's? I can write a personal message from you on a pretty card free of charge. Just write your message in the 'notes' section once you place your order. I have two different cards "I love you" or "Congratulations!", just choose the one you'd like in the drop down menu. If you don't leave a note with the order, I will assume you'd like to write the message yourself :)
SIZE: A5
COLOUR: Light Ivory background with stars
WORKSHEETS INCLUDED:
- Timeline and checklist;
- Inspiration moodboard;
- Budget plan;
- Venue Research;
- Extra entertainment;
- Guest list;
- The wedding party;
- Wedding theme and colours;
- Wedding stationery moodboard and research;
- Stationery tracker;
- Photographer Research;
- Band/Dj Research;
- Playlist;
- Caterers and menu research;
- Wedding dress  accessories moodboard and research;
- Transport research;
- Flower moodboard and florist research;
- Decor moodboard and research;
- Cake moodboard and research;
- Vows/readings and ceremony planning;
- Bridesmaids dresses moodboard and research;
- Groomswear research;
- Honeymoon research and planning (incl. packing list);
- Wedding favour moodboard;
- Invitation planning;
- Hair and make-up moodboards and research;
- Seating planner;
- Supplier contacts;
- Wedding day timeline;
- Emergency contacts;
- Wedding day checklist;
...and much more!
I also sell an A4 digital version of the same planner (you can download it instantly and print at home!) in various designs.
